import React from 'react';
import Header from '../components/Header';

// This is our detail page
const Detail = () => {
  return (
    <>
      <Header />
      <section className="detail-wrapper">
        <h1 className="detail-content">My Name Is Ragu</h1>
      </section>
    </>
  );
};

export default Detail;
